  \"2015-06-17T01:56:43.305649\",\n\t\"name\": \"recolonization-of-walrus-a-study-conducted-at-cape-peirce-alaska-togiak-national-wildlife-\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"From 1 June 1985 to 1 October 1985 the
  social behavior and population fluctuation of the walrus herd utilizing the Cape
  Peirce hauling grounds was observed and recorded. This study was a continuation
  of a program started by the Togiak National Wildlife Refuge, Dillingham, Alaska,
  to monitor the recolonization of a hauling grounds on Refuge land by a walrus population.
  Specific objectives were to collect data on population size and distribution and
  to record identifiable animals.\",\n\t\"license_title\": \"License Not Specified\",\n\t\"extras\":
